South Asians make up 25% of the world's population, but account for 50% of all cardiovascular deaths and there's not a lot of research as to why. 

The South Asian Heart Health Awareness and Research Act, a bill that aims to give grants to relevant research initiatives and awareness efforts has just been introduced in Congress.

@asanavoices, @thatdesispark, and @iaimpact have joined together to launch #SaveOurHearts in an effort to bring a much needed spotlight to this health crisis, but we couldn’t do it without the help of of our partners, including:
